import React from 'react'
import Signinbtn from '../SignIn-Btn/Signinbtn'
import "./Navbar.css"
const Navbar = (props) => {
    user = props.user
    return (
       <nav className='navbar'>
           <h3>React Social</h3>
           <Signinbtn props={props} />
       </nav>
    )
}

export default Navbar
